export const actionTypes = {
  CHANGE: 'AUTH_CHANGE',
  SUCCESS: 'AUTH_SUCCESS'
}

export const changeAuth = (data) => ({
  type: actionTypes.CHANGE,
  data
})

export const successAuth = (data) => ({
  type: actionTypes.SUCCESS,
  data
})
